import React,{ useRef } from 'react'
import { useScroll, useTransform, useAnimationFrame} from 'framer-motion';
import './Moving.css';
import {motion} from "framer-motion";
import skills from '../../img/5skills.jpg';


export const Moving = () => {

    const { scrollYProgress } = useScroll();
    const x = useTransform(scrollYProgress,[0,1],[0,-900]);

  return (

      <div>
        <div>
              <motion.h1 style={{x}} className='m m1'>DEVELOPER DESIGNER DEVELOPER DESIGNER DEVELOPER DESIGNER DEVELOPER</motion.h1>
        </div>


      </div>
  )
}

export const Moving2 =() =>{
    const { scrollYProgress } = useScroll();
    const x = useTransform(scrollYProgress,[1,0],[-200,-900]);

    return(
        <div>
              <motion.h1 style={{x}}className='m m2'>DESIGNER DEVELOPER DESIGNER DEVELOPER DESIGNER DEVELOPER DESIGNER</motion.h1>
        </div>
    )
}

export const Moving3 =()=>{
  const ref = useRef(null);
  const { scrollYProgress } = useScroll();
  const k = scrollYProgress;

  useAnimationFrame((t) => {
    const rotate = Math.sin(t / 10000) * 200;
    const y = (1 + Math.sin(t / 1000)) * -50;
    ref.current.style.transform = `translateY(${y+k}px) rotateX(${rotate}deg) rotateY(${rotate}deg)`;
  });

  return (
    <div className="container">
      <div className="cube" ref={ref}>
        <img src={skills} className="side front" alt="" />
        <img className="side left" alt=""/>
        <img className="side right"  alt=""/>
        <img className="side top"  alt=""/>
        <img className="side bottom" alt="" />
        <img className="side back"  alt=""/>
      </div>
    </div>
  );
}
